INSERT INTO `answers` VALUES (29, 14, 5, '2023-10-31 02:16:45', '2023-10-31 02:16:45', '<p>Navigate to the Video: Go to YouTube and find the video (Shorts or otherwise) that you want to embed. Click on the video to play it.<br><br>Click Share: Below the video player, you\'ll see a \"Share\" button. Click on it.<br><br>Choose Embed: After clicking the \"Share\" button, a small window will pop up with several sharing options. Among them, you will see \"Embed.\" Click on \"Embed.\"<br><br>Customize Embed Settings: An iframe code will appear. This is the embed code that you\'ll paste into your website or blog. Optionally, you can click on “SHOW MORE” under the embed code to reveal additional settings. These settings allow you to choose whether to start the video at a particular time, show player controls, enable privacy-enhanced mode, etc. Adjust these settings as desired.<br><br>Copy the Embed Code: After adjusting the settings (or if you\'re satisfied with the default settings), click on the embed code to select it. Copy the highlighted embed code (using Ctrl+C on Windows or Command+C on Mac).<br><br>Paste the Embed Code on Your Website: Navigate to the editor or backend of your website or blog. If you\'re using a WYSIWYG (What You See Is What You Get) editor, ensure you\'re in the code or HTML view. If you\'re directly editing the website\'s code, simply find the spot where you want to place the video. Paste the copied embed code (using Ctrl+V on Windows or Command+V on Mac) where you\'d like the video to appear on your page.<br><br>Save and Preview: Save your changes and then preview your website or blog post to make sure the video appears and plays as expected.<br><br>Remember that when you embed a YouTube video, you\'re relying on YouTube to host and serve that video. Ensure you have permission to share the content and that you adhere to both YouTube\'s terms of service and any copyright restrictions that might apply to the video.</p>', NULL, NULL);
INSERT INTO `answers` VALUES (25, 11, 1, '2023-10-31 01:33:45', '2023-10-31 01:33:45', '<p>This plugin use ChatGPT API to generate answers. It generates answer according to question title and content. It currently available with SCEditor and Default WYSIWYG Editor (CKEditor). To generate answer you just have to click \'Answer\' Button and Then \'Generate with ChatGPT\'. It will insert generated content into the editor.</p><figure class=\"image\"><img style=\"aspect-ratio:600/1071;\" src=\"http://127.0.0.1:8000/media/Screenshot_20231029-0657192_1698716011.png\" width=\"600\" height=\"1071\"></figure><p>&nbsp;</p>', NULL, NULL);
INSERT INTO `answers` VALUES (28, 13, 1, '2023-10-31 01:52:46', '2023-10-31 01:52:46', '<p>It\'s Just The First Impression. I\'m Still Working To Make It Better. If you want any changes you can request.</p><h2><strong>Features:</strong></h2><ul><li>Responsive for All Desktop, Tablet &amp; Mobile</li><li>Mobile First Design</li><li>SEO Friendly</li><li>Fast &amp; Furious</li><li><strong>Fully RTL Support</strong></li></ul><h2><strong>Modified Plugins Plugins:</strong></h2><ul><li>On Site Notification</li><li>Badges</li></ul><h2>Screenshots:</h2><p><img src=\"http://127.0.0.1:8000/media/sppi_1698717162.png\" width=\"600\" height=\"462\"></p>', NULL, NULL);
